      out.write("\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t学校是中国首批具有学士学位和硕士学位授予权单位之一、具有博士学位授予权高校，1962年开展研究生教育，是江西省最早进行研究生培养的高等学府，拥有“推荐免试研究生”资格。学校是中华人民共和国农业部、林业局 与江西省人民政府三方重点支持的省部共建高校，江西省核心建设的四所重点大学之一。入选国家“中西部高校基础能力建设工程”，国家首批卓越农林人才教育培养计划，国家“2011计划”，江西省“卓越工程师教育培养计划”，是教育部、科技部决定联合开展高等学校新农村发展研究院建设高校。\r\n");
      out.write("\t\t\t\t\t\r\n");
